import React, { Component } from "react";
import PropTypes from "prop-types";
import { Card, TextField, withStyles, CardContent, Box } from "@material-ui/core";

const styles = theme => ({
    card: {
        height: 800,
        width: '50%',
        marginTop: '7%',
        marginLeft: '25%',
        border: '1px solid black'
    },
    CardContent: {
        marginTop: '5%',
        marginLeft: '10%',
    }

});

class CardComponent extends Component {
    render() {
        const { classes, } = this.props;
        return (
            <Card className={classes.card}>
                <CardContent className={classes.CardContent}>
                    <Box></Box>
                    <TextField className={classes.TextField} label="Mentee Name" />
                    <br />
                    <br />
                    <TextField  className={classes.TextField} label="Mentor Name" />
                    <br />
                    <br />
                    <TextField  label="How much month spend here" />
                    <br />
                    <br />
                    <TextField label="Where is in study" />
                    <br />
                    <br />
                    <TextField label="How was study is going" />
                    <br />
                    <br />
                    <TextField label="English Mentor" />
                    <br />
                    <br />
                    <TextField label="From Where" />
                    <br />
                    <br />
                    <TextField label="How much she done" />
                    <br />
                    <br />
                    <TextField label="Mentor Problem" />
                    <br />
                    <br />
                    <TextField label="Study Schedule" />
                    <br />
                    <br />
                    <TextField label="How many hours doing study" />
                </CardContent>
            </Card>
        );
    }
}

CardComponent.propTypes = {
    classes: PropTypes.object.isRequired
};

export default withStyles(styles)(CardComponent);
